DROP TABLE IF EXISTS `SYS_TASK`;
CREATE TABLE `SYS_TASK` (
  `ID` decimal(20,0) NOT NULL COMMENT '主键',
  `NAME` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '任务名',
  `JOB_GROUP` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '任务组',
  `JOB_CLASS` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '执行类',
  `NOTE` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '任务说明',
  `CRON` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '定时规则',
  `DATA` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '执行参数',
  `EXEC_AT` datetime DEFAULT NULL COMMENT '执行时间',
  `EXEC_RESULT` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '执行结果',
  `DISABLED` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '是否禁用1禁用 0启用',
  `CONCURRENT` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '是否允许并发',
  `CREATE_TIME` datetime DEFAULT NULL,
  `CREATE_USER` decimal(20,0) DEFAULT NULL,
  `UPDATE_TIME` datetime DEFAULT NULL,
  `UPDATE_USER` decimal(20,0) DEFAULT NULL,
  `DELETE_FLAG` char(1) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '删除标记',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='定时任务';

